import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 20, height: 20, viewBox: "0 0 20 20", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M17 10a7 7 0 10-10 6.33V14.5a.5.5 0 011 0v3a.5.5 0 01-.5.5h-3a.5.5 0 010-1h1.62A8 8 0 1118 10a.5.5 0 01-1 0z", fill: primaryFill }),
        React.createElement("path", { d: "M10 12a2 2 0 110-4 2 2 0 010 4zm0-1a1 1 0 100-2 1 1 0 000 2z", fill: primaryFill }));
};
const ArrowRotateCounterclockwise20Regular = wrapIcon(rawSvg({}), 'ArrowRotateCounterclockwise20Regular');
export default ArrowRotateCounterclockwise20Regular;
